--  DDL for View HAVI_BEVETEL_STAT
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "ADMIN"."HAVI_BEVETEL_STAT" ("HONAP", "BEVETEL") DEFAULT COLLATION "USING_NLS_COMP"  AS 
  SELECT
  TO_CHAR(letrehozas_datuma, 'YYYY-MM') AS honap,
  SUM(osszeg) AS bevetel
FROM szamla
WHERE all_id IN (2, 4)  -- csak fizetett/lezárt számlák
GROUP BY TO_CHAR(letrehozas_datuma, 'YYYY-MM')
ORDER BY honap
;
--------------------------------------------------------
--  DDL for View LEGAKTIVABB_FELHASZNALOK
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "ADMIN"."LEGAKTIVABB_FELHASZNALOK" ("FELHASZNALO", "DOMAINEK_SZAMA", "WEBTARHELYEK_SZAMA", "SZAMLAK_SZAMA") DEFAULT COLLATION "USING_NLS_COMP"  AS 
  SELECT
    f.nev AS felhasznalo,
    COUNT(DISTINCT d.d_id) AS domainek_szama,
    COUNT(DISTINCT w.w_id) AS webtarhelyek_szama,
    COUNT(DISTINCT sz.sz_id) AS szamlak_szama
FROM felhasznalo f
LEFT JOIN domain d ON f.u_id = d.u_id
LEFT JOIN webtarhely w ON f.u_id = w.u_id
LEFT JOIN szamla sz ON f.u_id = sz.u_id
GROUP BY f.nev
ORDER BY 
    COUNT(DISTINCT d.d_id) + 
    COUNT(DISTINCT w.w_id) + 
    COUNT(DISTINCT sz.sz_id) DESC
;
--------------------------------------------------------
--  DDL for View LEGNEZETTEBB_DOMAIN
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "ADMIN"."LEGNEZETTEBB_DOMAIN" ("DOMAIN_NEV", "TULAJDONOS", "MEGTEKINTES") DEFAULT COLLATION "USING_NLS_COMP"  AS 
  SELECT
  d.domain_nev,
  f.nev AS tulajdonos,
  d.megtekintes
FROM domain d
JOIN felhasznalo f ON d.u_id = f.u_id
ORDER BY d.megtekintes DESC
;
