  CREATE OR REPLACE FORCE EDITIONABLE VIEW "ADMIN"."LEGTOBBET_FIZETOK" ("FELHASZNALO_NEV", "OSSZES_FIZETES") DEFAULT COLLATION "USING_NLS_COMP"  AS 
