--  DDL for Trigger SZAMLA_FIZETES_KESES
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE TRIGGER "ADMIN"."SZAMLA_FIZETES_KESES" 
BEFORE UPDATE ON szamla
FOR EACH ROW
BEGIN
  IF :OLD.all_id = 3 AND :NEW.all_id = 3 AND
     MONTHS_BETWEEN(SYSDATE, :OLD.letrehozas_datuma) > 2 THEN
    :NEW.all_id := 41; -- 41 = Késedelmes
  END IF;
END;
/
ALTER TRIGGER "ADMIN"."SZAMLA_FIZETES_KESES" ENABLE;
--------------------------------------------------------
--  DDL for Trigger SZAMLA_LETREHOZAS
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE TRIGGER "ADMIN"."SZAMLA_LETREHOZAS" 
AFTER INSERT ON elofizet
FOR EACH ROW
DECLARE
  v_ar NUMBER;
BEGIN
  SELECT ar INTO v_ar
  FROM dijcsomag
  WHERE d_id = :NEW.d_id;

  VALUES (v_ar, SYSTIMESTAMP, :NEW.u_id, 3);
EXCEPTION
  WHEN NO_DATA_FOUND THEN
    RAISE_APPLICATION_ERROR(-20002, 'A megadott d_id-hez nem található díjcsomag.');
END;
/
ALTER TRIGGER "ADMIN"."SZAMLA_LETREHOZAS" ENABLE;
