--------------------------------------------------------
--  DDL for Procedure FIZETESI_HATRALEK_KEZELESE
--------------------------------------------------------
set define off;

  CREATE OR REPLACE EDITIONABLE PROCEDURE "ADMIN"."FIZETESI_HATRALEK_KEZELESE" (
    p_felhasznalo_id NUMBER,
    p_kimenet OUT VARCHAR2
)
AS
    v_count NUMBER := 0;
    e_nincs_fizetendo EXCEPTION;
    PRAGMA EXCEPTION_INIT(e_nincs_fizetendo, -20002);
BEGIN

    -- Felfüggesztés + szolgáltatás blokkolása
    SELECT COUNT(*) INTO v_count
    FROM szamla
    WHERE u_id = p_felhasznalo_id
      AND all_id = 41
      AND MONTHS_BETWEEN(SYSDATE, letrehozas_datuma) > 6;

    IF v_count > 0 THEN
        UPDATE szamla
        SET all_id = 21  -- Felfüggesztett
        WHERE u_id = p_felhasznalo_id
          AND all_id = 41
          AND MONTHS_BETWEEN(SYSDATE, letrehozas_datuma) > 6;

        UPDATE webtarhely
        SET allapot = 0
        WHERE u_id = p_felhasznalo_id;

        UPDATE domain
        SET allapot = 0
        WHERE u_id = p_felhasznalo_id;
    END IF;

    -- Értesítés
    p_kimenet := 'Fizetési hátralék miatt a szolgáltatásai korlátozva lettek. Kérjük, rendezze a tartozását!';

EXCEPTION
    WHEN e_nincs_fizetendo THEN
        p_kimenet := 'A felhasználónak nincs rendezetlen számlája.';
    WHEN OTHERS THEN
        p_kimenet := 'Hiba történt: ' || SQLERRM;
END;

/
