--------------------------------------------------------
--  DDL for Procedure KARBANTART_LOGON_STAT
--------------------------------------------------------
set define off;

  CREATE OR REPLACE EDITIONABLE PROCEDURE "ADMIN"."KARBANTART_LOGON_STAT" 
AS
  v_rekord_szam NUMBER;
BEGIN
  -- Lekérdezzük a rekordok számát
  SELECT COUNT(*) INTO v_rekord_szam FROM Logon_stat;

  -- Ha a rekordok száma meghaladja a 10-et, töröljük az összes rekordot
  IF v_rekord_szam > 10 THEN
    DELETE FROM Logon_stat;
    DBMS_OUTPUT.PUT_LINE('Minden rekord törölve.');
  ELSE
    DBMS_OUTPUT.PUT_LINE('Nincs szükség karbantartásra.');
  END IF;
END;

/
--------------------------------------------------------
--  DDL for Procedure NOVELI_MEGTEKINTESEKET
--------------------------------------------------------
set define off;

  CREATE OR REPLACE EDITIONABLE PROCEDURE "ADMIN"."NOVELI_MEGTEKINTESEKET" IS
BEGIN

  UPDATE domain d
  SET megtekintes = ROUND(megtekintes * 1.02)
  WHERE d.dij_id IN (
    SELECT d_id FROM dijcsomag
    WHERE LOWER(neve) LIKE '%alap%'
  );


  UPDATE domain d
  SET megtekintes = ROUND(megtekintes * 1.10)
  WHERE d.dij_id IN (
    SELECT d_id FROM dijcsomag
    WHERE LOWER(neve) LIKE '%plusz%' OR LOWER(neve) LIKE '%prémium%'
  );


  UPDATE domain d
  SET megtekintes = ROUND(megtekintes * 1.20)
  WHERE d.dij_id IN (
    SELECT d_id FROM dijcsomag
    WHERE LOWER(neve) LIKE '%vállalkozói%'
  );


  COMMIT;
END;

/
--------------------------------------------------------
--  DDL for Procedure SZAMLAK_ELLENORZES
--------------------------------------------------------
set define off;

  CREATE OR REPLACE EDITIONABLE PROCEDURE "ADMIN"."SZAMLAK_ELLENORZES" IS
BEGIN
  -- Függőben lévő számlák újrafrissítése (szamla_fiztes_keses trigger kiváltásához)
  UPDATE szamla
  SET all_id = all_id
  WHERE all_id = 3
    AND MONTHS_BETWEEN(SYSDATE, letrehozas_datuma) > 2;

  -- Lezárt számlák frissítése (szamla_torolt_allapotra trigger kiváltásához)
  UPDATE szamla
  SET all_id = all_id
  WHERE all_id = 4
    AND MONTHS_BETWEEN(SYSDATE, letrehozas_datuma) > 12;

  COMMIT;
END;

