Insert into ADMIN.TUDASTAR (T_ID,KATEGORIA,KERDES_SZOVEG,VALASZ_SZOVEG) values ('41','5','Mire való a webtárhely?','A webtárhelyen tudod tárolni a weboldalad fájljait, például a képeket, dokumentumokat vagy magát a honlapot.');
Insert into ADMIN.TUDASTAR (T_ID,KATEGORIA,KERDES_SZOVEG,VALASZ_SZOVEG) values ('42','5','Mi történik, ha elfogy a tárhelyem?','Ha eléri a maximális méretet, új fájlokat már nem tudsz feltölteni, amíg nem bővítesz vagy nem törölsz belőle.');
Insert into ADMIN.TUDASTAR (T_ID,KATEGORIA,KERDES_SZOVEG,VALASZ_SZOVEG) values ('43','5','Hogyan foglalhatok le egy webtárhelyet?','Miután regisztráltál és kiválasztottál egy díjcsomagot, a szabad tárhelyek közül választhatsz magadnak.');
Insert into ADMIN.TUDASTAR (T_ID,KATEGORIA,KERDES_SZOVEG,VALASZ_SZOVEG) values ('45','2','Lejár a belépésem egy idő után?','Igen, a belépéshez használt token időkorlátos, így egy idő után újra be kell jelentkezned.');
Insert into ADMIN.TUDASTAR (T_ID,KATEGORIA,KERDES_SZOVEG,VALASZ_SZOVEG) values ('46','3','Mi történik, ha túllépem a díjcsomagom kereteit?','Ha túl sok domaint vagy túl nagy tárhelyet akarsz használni, a rendszer nem engedi a lefoglalást.');
Insert into ADMIN.TUDASTAR (T_ID,KATEGORIA,KERDES_SZOVEG,VALASZ_SZOVEG) values ('48','5','Mi történik, ha elfogy a tárhelyem?','Ha eléri a maximális méretet, új fájlokat már nem tudsz feltölteni, amíg nem bővítesz vagy nem törölsz belőle.');
Insert into ADMIN.TUDASTAR (T_ID,KATEGORIA,KERDES_SZOVEG,VALASZ_SZOVEG) values ('1','1','Hogyan hozhatok létre új felhasználót??','A Felhasználók menüpontban kattints az Új felhasználó gombra.');
Insert into ADMIN.TUDASTAR (T_ID,KATEGORIA,KERDES_SZOVEG,VALASZ_SZOVEG) values ('2','2','Hogyan módosíthatom a jelszavamat?','A Profil beállításai menüpontban kattints a Jelszó módosítása gombra.');
Insert into ADMIN.TUDASTAR (T_ID,KATEGORIA,KERDES_SZOVEG,VALASZ_SZOVEG) values ('3','3','Mik a díjcsomagok árai?','Az árakat a Díjcsomagok menüpontban találhatod.');
Insert into ADMIN.TUDASTAR (T_ID,KATEGORIA,KERDES_SZOVEG,VALASZ_SZOVEG) values ('4','1','Hogyan lehet domain nevet regisztrálni?','A Domain regisztráció menüpontban kattints az Új domain gombra.');
Insert into ADMIN.TUDASTAR (T_ID,KATEGORIA,KERDES_SZOVEG,VALASZ_SZOVEG) values ('44','1','Milyen szerepköröm lehet a rendszerben?','Alapértelmezetten felhasználóként regisztrálsz, de admin jogosultság is létezhet a rendszerben.');
Insert into ADMIN.TUDASTAR (T_ID,KATEGORIA,KERDES_SZOVEG,VALASZ_SZOVEG) values ('47','4','Hány domainem lehet egyszerre?','Ez a választott díjcsomagodtól függ. Egyes csomagok csak 1-2, mások akár 10+ domain kezelését is engedik.');
